  summary: Gets a collection of custom values that are passed to the route handler but are not used when ASP.NET routing determines whether the route matches a request.
  remarks: You use the <xref:System.Web.Routing.RouteData.DataTokens%2A> property to retrieve values associated with the route that are not used when ASP.NET routing determines whether a route matches a request. A custom route handler might have to retrieve these values when it is processing the request.
